import React, { useState } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { Button, Modal, Fade, Backdrop } from '@material-ui/core';
import TextField from '@material-ui/core/TextField';
import {StyleSignIn} from './StyleSignIn'


const useStyles = makeStyles((theme) => ({
    paper: {
        position: 'absolute',
        width: 300,
        backgroundColor: theme.palette.background.paper,
        border: '2px solid #000',
        boxShadow: theme.shadows[5],
        padding: theme.spacing(2, 4, 3),
    },
    root: {
        border: '2px solid red',
        width: `50%`,
    }
}));


const SignUpButton = () => {
    const classes = useStyles();
    const [open, setOpen] = useState(false);
    const [modalStyle] = useState(getModalStyle);
    
    const handleOpen = () => {
        setOpen(true);
    }
    const handleClose = () => {
        setOpen(false);
    };
    const body = (
        <StyleSignIn style={modalStyle} className={classes.paper}>
            <form className={classes.root} noValidate autoComplete="off">
                <TextField id="outlined-basic" label="Outlined" variant="outlined" />
                <TextField id="outlined-basic" label="Outlined" variant="outlined" />
            </form>
        </StyleSignIn>
    );
    return (
        <React.Fragment>
            <Button className="btn-signin" onClick={handleOpen}>Sign in</Button>
            <Modal
                open={open}
                onClose={handleClose}
            >
                <Modal
                    className={classes.modal}
                    open={open}
                    onClose={handleClose}
                    closeAfterTransition
                    BackdropComponent={Backdrop}
                    BackdropProps={{
                        timeout: 500,
                    }}
                >
                    {body}
                </Modal>
            </Modal>
        </React.Fragment>
    );
}

export default SignUpButton;
